        <div class="mui-container">
            <p>
                <strong>
                    Multithreading
                </strong>
            </p>
            <ul>
                <li>
                    Zpracov&aacute;n&iacute; v&iacute;ce vl&aacute;ken najednou
                </li>
            </ul>
            <p>
                <strong>
                    Hyperthreding
                </strong>
            </p>
            <ul>
                <li>
                    Jeden fyzick&yacute; procesor na venek se tv&aacute;ř&iacute; jako dva logick&eacute;
                </li>
                <li>
                    Duplikovan&eacute; registry a řadič přeru&scaron;en&iacute;
                </li>
                <li>
                    Na vstupu přijme dvě vl&aacute;kna a bude je zpracov&aacute;vat současně za předpokladu že každ&eacute; potřebuje jinou jednotku &ndash; tom př&iacute;padě dojde ke zrychlen&iacute;
                </li>
                <li>
                    Pokud by potřebovali stejnou jednotku tak ke zrychlen&iacute; nedojde
                </li>
                <li>
                    Vynalezen Intelem
                </li>
                <li>
                    Jednotliv&eacute; technologie se můžou kombinovat (v&iacute;ce j&aacute;drov&yacute; procesor může m&iacute;t hyperthreading)
                </li>
                <li>
                    V&yacute;kon nikdy nenarůst&aacute; line&aacute;rně
                </li>
            </ul>
            <p>
                <strong>
                    Hypertransport
                </strong>
            </p>
            <ul>
                <li>
                    Sběrnice umožňuj&iacute;c&iacute; vysokou propustnost komunikaci z&nbsp;čipu na čip
                </li>
                <li>
                    Propojuje paměti, řadič, j&aacute;dra
                </li>
                <li>
                    Je fullduplex = obousměrn&aacute; komunikace
                </li>
            </ul>
            <p>
                <strong>
                    Multiprocesory
                </strong>
            </p>
            <ul>
                <li>
                    Syst&eacute;m, kter&yacute; m&aacute; v&iacute;ce procesorů, je centr&aacute;lně ř&iacute;zen a se společnou pamět&iacute;
                </li>
                <li>
                    Procesory jsou zapojeny do jedn&eacute; sběrnice
                </li>
                <li>
                    Vždy ře&scaron;&iacute; jednu &uacute;lohu a ř&iacute;zen&iacute; cel&eacute;ho syst&eacute;mu ř&iacute;d&iacute; jeden OS a společn&aacute; data jsou v&nbsp;jedn&eacute; společn&eacute; paměti
                </li>
                <li>
                    V&yacute;hodn&aacute; je vysok&aacute; spolehlivost
                </li>
                <li>
                    Zvy&scaron;uje se v&yacute;kon
                </li>
            </ul>
            <p>
                <strong>
                    Procesorov&aacute; pole (Maticov&eacute; procesory)
                </strong>
            </p>
            <ul>
                <li>
                    Je sestavena ze stejn&yacute;ch procesorů , jsou navz&aacute;jem propojeny a jsou spojeny s&nbsp;centr&aacute;ln&iacute;m řadičem
                </li>
                <li>
                    Každ&yacute; procesor m&aacute; vlastn&iacute; paměť
                </li>
                <li>
                    Data se zad&aacute;vaj&iacute; pouze do krajn&iacute;ch procesorů, kter&eacute; jsou připojeny ke sběrnici
                </li>
                <li>
                    <img src="data:image/jpeg;base64,">
                    Procesory můžou pracovat se stejn&yacute;mi daty
                </li>
            </ul>
